INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (63, 2, 1, "2025/01/31 12:00:00", 4, "2030/01/01 14:59:59", 2, 0.0, "報酬がもらえますよ！\nチェックしてみてください", "カリン", 0.0, 1000004, 190801, -416.5);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (64, 1, 1, "2025/01/31 12:00:00", 5, "2030/01/01 14:59:59", 2, 2.12, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", "カリン", 0.0, 1000005, 190801, -363.0);
