INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (64, 1, 1, "2025/01/31 12:00:00", 7, "2030/01/01 14:59:59", 2, 2.33, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", "カリン", 0.0, 1000007, 190801, -363.0);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (61, 7, 10201, "2025/01/31 12:00:00", 101, "2030/01/01 14:59:59", 3, 5.18, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", "ラビリスタ", -6.0, 1020101, 133701, -285.0);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (61, 2, 10201, "2025/01/31 12:00:00", 201, "2030/01/01 14:59:59", 1, 8.77, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", "クリスティーナ", -2.0, 1020102, 133901, -285.0);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (61, 1, 10201, "2025/01/31 12:00:00", 301, "2030/01/01 14:59:59", 6, 15.5, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", "ネネカ", 0.0, 1020103, 133801, -285.0);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (61, 5, 10202, "2025/02/28 12:00:00", 101, "2030/01/01 14:59:59", 2, 9.061, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", "ランファ", 0.0, 1020201, 134301, -285.0);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (61, 2, 10202, "2025/02/28 12:00:00", 201, "2030/01/01 14:59:59", 1, 7.699, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", "チカ", 0.0, 1020202, 134401, -285.0);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (61, 2, 10203, "2025/03/31 12:00:00", 101, "2030/01/01 14:59:59", 1, 8.595, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", "アオイ", 0.0, 1020301, 134601, -285.0);
INSERT INTO `v1_3c86cab0d3758e21e91551f61ad34df296b406b03f7a2d7f7952793dd7099723` VALUES (61, 2, 10203, "2025/03/31 12:00:00", 201, "2030/01/01 14:59:59", 1, 7.758, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", "クローチェ", 0.0, 1020302, 134501, -285.0);
